      out.write("\t\r\n");
      out.write("\t<div class=\"d33\">\r\n");
      out.write("\t<div class=\"d3\">\r\n");
      out.write("\t\t<span style=\"background-color: gray; float: left\"  id=\"qna0\">Q.상품 교환을 신청했는데, 환불로 변경하고 싶습니다. 어디에서 할 수 있나요?</span>\r\n");
      out.write("\t\t<span>\r\n");
      out.write("\t\t\t\t<textarea style=\"font-size: 15px;\" id=\"q0\"  class=\"q1\"  rows=\"200\" cols=\"200\" readonly=\"readonly\">\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t교환철회 후 환불로 재접수, 또는 고객센터로 문의\r\n");
      out.write("\r\n");
      out.write("\t\t교환신청 후 환불로 변경을 원하실 경우 [마이페이지→ 구매내역]에서 \r\n");
      out.write("\r\n");
      out.write("\t\t교환철회 후 환불로 다시 접수해주시면 됩니다.\r\n");
      out.write("\r\n");
      out.write("\t\t단, 교환철회 버튼이 노출되지 않는 경우에는 직접 처리가 불가하오니, \r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t이 경우에는 1:1문의 게시판 또는 고객센터 (1544-6240)로 문의 해 주시기 바랍니다. \r\n");
      out.write("\r\n");
      out.write("\t\t※ 단, 교환상품이 이미 발송 된 경우 변경은 불가합니다.\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t\t\t</textarea>\r\n");
      out.write("\t\t\t\t</span>\r\n");
      out.write("\t\t<br><br>\r\n");
      out.write("<!-- \t\t//////////////////////////////////////////////////////////// -->\r\n");
      out.write("\r\n");
      out.write("\t\t<span style=\"float: left; float: left;\" id=\"qna1\">Q.배송상품을 받았는데 파손이 됐습니다. 어떻게 해야 하나요?</span>\r\n");
      out.write("\t\t<span>\r\n");
      out.write("\t\t\t\t<textarea style=\"font-size: 15px;\" id=\"q1\"  class=\"q1\" rows=\"200\" cols=\"200\" readonly=\"readonly\">\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t고객센터로 문의\r\n");
      out.write("\r\n");
      out.write("\t\t수령하신 상태 그대로를 사진으로 남기신 후, \r\n");
      out.write("\t\t\r\n");
      out.write("\t\t1:1문의 게시판을 통해 사진을 첨부하여 문의를 주시면 \r\n");
      out.write("\t\t\r\n");
      out.write("\t\t신속히 확인하여 답변드리겠습니다.\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t\t\t</textarea>\r\n");
      out.write("\t\t\t</span>\r\n");
      out.write("\t\t<br><br>\r\n");
      out.write("\t\t\r\n");
      out.write("\t\t<span style=\"background-color: gray;float: left;\" id=\"qna2\">Q.배송지연으로 환불했는데, 상품이 배송되었어요. 어떻게 해야 하나요?</span>\r\n");
      out.write("\t\t<span>\r\n");
      out.write("\t\t\t\t<textarea style=\"font-size: 15px;\"  id=\"q2\"  class=\"q1\" rows=\"200\" cols=\"200\" readonly=\"readonly\">\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t배송된 상품은 수취거절\r\n");
      out.write("\r\n");
      out.write("\t\t환불완료 후, 배송된 상품은 수취거절 해 주시기 바랍니다.\r\n");
      out.write("\r\n");
      out.write("\t\t수취거절을 하시지 못한 경우, \r\n");
      out.write("\t\t\r\n");
      out.write("\t\t상품수거를 위해 1:1문의 게시판\r\n");
      out.write("\t\t\r\n");
      out.write("\t\t 또는 고객센터(1544-6240)로 문의 해 주시기 바랍니다.\r\n");
      out.write("\r\n");
      out.write("\t\t※ 반품을 하지 않는 경우, 상품금액을 입금요청할 수 있습니다.\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t\t\t</textarea>\r\n");
      out.write("\t\t\t\t</span>\r\n");
      out.write("\t\t<br><br>\r\n");
      out.write("\t\t<span style=\"float: left;\" id=\"qna3\">Q.휴면 안내 메일을 받았는데, 제 개인정보를 삭제하고 싶어요.</span>\r\n");
      out.write("\t\t<span>\r\n");
      out.write("\t\t\t\t<textarea style=\"font-size: 15px;\" id=\"q3\"  class=\"q1\" rows=\"200\" cols=\"200\" readonly=\"readonly\">\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t로그인 후 [마이페이지→개인정보] 하단에서 탈퇴\r\n");
      out.write("\r\n");
      out.write("\t\t휴면 안내 메일은 휴면 전환 전의 사전 안내 메일이며, \r\n");
      out.write("\t\t\r\n");
      out.write("\t\t안내 된 예정일에 맞춰 휴면 계정으로 전환됩니다. \r\n");
      out.write("\r\n");
      out.write("\t\t만약 정보보관이나 티몬 이용을 원치 않으신다면, \r\n");
      out.write("\t\t\r\n");
      out.write("\t\t로그인 후 [마이페이지→개인정보] 하단에서 탈퇴 하실 수 있습니다.\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t\t\t</textarea>\r\n");
      out.write("\t\t\t\t</span>\r\n");
      out.write("\t\t<br><br>\r\n");
      out.write("\t\t<span style=\"background-color: gray;float: left;\" id=\"qna4\">Q.휴면 전환에 대한 안내 메일을 받았어요.</span>\r\n");
      out.write("\t\t<span>\r\n");
      out.write("\t\t\t\t<textarea style=\"font-size: 15px;\"  id=\"q4\"  class=\"q1\" rows=\"200\" cols=\"200\" readonly=\"readonly\">\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t휴면 계정으로 전환되기 전 메일을 통해 사전 안내\r\n");
      out.write("\r\n");
      out.write("\t\t고객님의 개인정보 보호를 위해 정보통신망 이용촉진 \r\n");
      out.write("\t\t\r\n");
      out.write("\t\t및 정보보호 등에 관한 법률에 따라\r\n");
      out.write("\r\n");
      out.write("\t\t1년 동안 티몬 서비스를 이용하지 않은 고객님의 계정은 휴면으로 전환 됩니다.\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t휴면 계정으로 전환되기 전 메일을 통해 사전 안내를 드리고 있습니다. \r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t\t\t</textarea>\r\n");
      out.write("\t\t\t\t</span>\r\n");
      out.write("\t\t<br><br>\r\n");
      out.write("\t\t<span style=\"float: left;\"  id=\"qna5\">Q.휴면 계정인데 탈퇴하고 싶어요.</span>\r\n");
      out.write("\t\t<span>\r\n");
      out.write("\t\t\t\t<textarea style=\"font-size: 15px;\" id=\"q5\"  class=\"q1\" rows=\"200\" cols=\"200\" readonly=\"readonly\">\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t휴면 해제 후 탈퇴 가능\r\n");
