      out.write("\t\t휴면 계정 상태에서는 즉시 탈퇴가 어려우며, \r\n");
      out.write("\t\t\r\n");
      out.write("\t\t휴면 해제 후 [마이페이지→개인정보] 하단에서 하실 수 있습니다.\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t휴면 해제는 로그인 시 노출되는 휴면계정 안내 창에서 \r\n");
      out.write("\t\t\r\n");
